import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  const [currentFeature, setCurrentFeature] = useState(0);
  const [mousePosition, setMousePosition] = useState({ x: 0, y: 0 });

  const features = [
    { icon: 'âš¡', text: 'Instant Booking' },
    { icon: 'ðŸŽ¯', text: 'Premium Fleet' },
    { icon: 'ðŸ›¡ï¸', text: 'Full Insurance' },
    { icon: 'ðŸŒŸ', text: '5-Star Service' }
  ];

  useEffect(() => {
    const interval = setInterval(() => {
      setCurrentFeature((prev) => (prev + 1) % features.length);
    }, 3000);
    return () => clearInterval(interval);
  }, []);

  useEffect(() => {
    const handleMouseMove = (e) => {
      setMousePosition({
        x: (e.clientX / window.innerWidth - 0.5) * 20,
        y: (e.clientY / window.innerHeight - 0.5) * 20
      });
    };
    window.addEventListener('mousemove', handleMouseMove);
    return () => window.removeEventListener('mousemove', handleMouseMove);
  }, []);

  return (
    <section className="min-h-screen relative overflow-hidden grid-pattern">
      {/* Background Elements dengan Parallax */}
      <div 
        className="absolute top-1/4 -left-10 w-72 h-72 bg-blue-500/10 rounded-full blur-3xl animate-float"
        style={{ transform: `translate(${mousePosition.x * 0.5}px, ${mousePosition.y * 0.5}px)` }}
      ></div>
      <div 
        className="absolute bottom-1/4 -right-10 w-96 h-96 bg-purple-500/10 rounded-full blur-3xl animate-float"
        style={{ 
          animationDelay: '2s',
          transform: `translate(${mousePosition.x * 0.3}px, ${mousePosition.y * 0.3}px)` 
        }}
      ></div>

      <div className="container-custom section-padding relative z-10">
        <div className="grid grid-cols-1 lg:grid-cols-2 gap-16 items-center">
          {/* Content */}
          <div className="text-center lg:text-left">
            {/* Badge */}
            <div className="inline-flex items-center glass rounded-full px-6 py-3 mb-8 animate-pulse-glow">
              <div className="w-2 h-2 bg-green-400 rounded-full mr-2 animate-ping"></div>
              <span className="text-sm font-semibold text-green-400">PREMIUM LUXURY FLEET</span>
            </div>

            <h1 className="text-5xl md:text-6xl lg:text-7xl font-black leading-tight mb-6">
              <span className="text-white">Experience</span>
              <br />
              <span className="text-gradient">Luxury</span>
              <br />
              <span className="text-white">Mobility</span>
            </h1>

            <p className="text-xl text-gray-300 mb-8 max-w-lg mx-auto lg:mx-0 leading-relaxed">
              Discover the future of car rental with our <span className="text-gradient font-semibold">premium fleet</span> and <span className="text-gradient font-semibold">cutting-edge technology</span>.
            </p>

            {/* Auto-rotating Feature */}
            <div className="glass rounded-2xl p-6 mb-8 max-w-md mx-auto lg:mx-0">
              <div className="flex items-center justify-center lg:justify-start space-x-4">
                <span className="text-3xl">{features[currentFeature].icon}</span>
                <span className="text-lg font-semibold text-white">{features[currentFeature].text}</span>
              </div>
            </div>

            {/* CTA Buttons */}
            <div className="flex flex-col sm:flex-row gap-4 justify-center lg:justify-start">
              <Link to="/kendaraan" className="btn-primary group relative overflow-hidden text-center">
                <span className="relative z-10">Explore Our Fleet</span>
                <div className="absolute inset-0 bg-gradient-to-r from-purple-600 to-blue-500 transform scale-x-0 group-hover:scale-x-100 transition-transform duration-500 origin-left"></div>
              </Link>
              <button className="btn-secondary group">
                <span className="relative z-10">Watch Demo</span>
              </button>
            </div>

            {/* Stats */}
            <div className="grid grid-cols-3 gap-8 mt-16 max-w-md mx-auto lg:mx-0">
              {[
                { number: '500+', label: 'Premium Cars' },
                { number: '10K+', label: 'Happy Clients' },
                { number: '50+', label: 'Cities' }
              ].map((stat, index) => (
                <div key={index} className="text-center lg:text-left">
                  <div className="text-2xl font-black text-gradient mb-1">{stat.number}</div>
                  <div className="text-sm text-gray-400">{stat.label}</div>
                </div>
              ))}
            </div>
          </div>

          {/* Hero Visual */}
          <div className="relative">
            {/* Main Card */}
            <div 
              className="glass rounded-3xl p-8 transform rotate-2 hover:rotate-0 transition-transform duration-500"
              style={{ transform: `rotate(2deg) translate(${mousePosition.x * 0.1}px, ${mousePosition.y * 0.1}px)` }}
            >
              <div className="glass-dark rounded-2xl p-6 transform -rotate-2">
                <div className="bg-gradient-to-br from-slate-800 to-slate-900 rounded-2xl h-96 flex items-center justify-center relative overflow-hidden">
                  {/* Car Silhouette */}
                  <div className="absolute inset-0 flex items-center justify-center">
                    <div className="w-64 h-32 bg-gradient-to-r from-blue-500/20 to-purple-500/20 rounded-2xl relative">
                      <div className="absolute -top-4 left-8 w-48 h-6 bg-gradient-to-r from-blue-500/30 to-purple-500/30 rounded-full"></div>
                      <div className="absolute -bottom-2 left-4 w-8 h-8 bg-blue-500/20 rounded-full"></div>
                      <div className="absolute -bottom-2 right-4 w-8 h-8 bg-purple-500/20 rounded-full"></div>
                    </div>
                  </div>

                  {/* Floating Elements */}
                  <div className="absolute top-4 left-4 w-8 h-8 bg-blue-500/20 rounded-full animate-float"></div>
                  <div className="absolute top-8 right-8 w-6 h-6 bg-purple-500/20 rounded-full animate-float" style={{animationDelay: '1s'}}></div>
                  <div className="absolute bottom-8 left-12 w-4 h-4 bg-blue-500/20 rounded-full animate-float" style={{animationDelay: '2s'}}></div>
                </div>
              </div>
            </div>

            {/* Floating Badges */}
            <div 
              className="absolute -top-4 -right-4 glass rounded-2xl p-4 animate-float"
              style={{ transform: `translate(${mousePosition.x * 0.2}px, ${mousePosition.y * 0.2}px)` }}
            >
              <div className="flex items-center space-x-2">
                <div className="w-3 h-3 bg-green-400 rounded-full animate-pulse"></div>
                <span className="text-sm font-semibold text-white">Available</span>
              </div>
            </div>

            <div 
              className="absolute -bottom-4 -left-4 bg-gradient-to-r from-blue-500 to-purple-600 rounded-2xl p-4 animate-float"
              style={{ 
                animationDelay: '3s',
                transform: `translate(${mousePosition.x * 0.15}px, ${mousePosition.y * 0.15}px)` 
              }}
            >
              <div className="flex items-center space-x-2">
                <span className="text-sm font-bold text-white">$99/Day</span>
              </div>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Home;
